SELECT  筹资活动现金流入小计 
FROM Cash_Flow_Statement 
WHERE 年度 = '2021' AND 股票代码 = 40;

SELECT 经营活动现金流入小计 
FROM Cash_Flow_Statement 
WHERE 年度 = 2022 AND 股票代码 = 8;

SELECT  Cash_Flow_Statement.股票代码, Cash_Flow_Statement.股票简称, Cash_Flow_Statement.年度, Cash_Flow_Statement.分配股利、利润或偿付利息支付的现金 
FROM Cash_Flow_Statement 
WHERE Cash_Flow_Statement.股票代码 = 5 AND Cash_Flow_Statement.年度 = 2022;

SELECT Cash_Flow_Statement.股票代码, Cash_Flow_Statement.股票简称, Cash_Flow_Statement.年度, Cash_Flow_Statement.偿还债务支付的现金
FROM Cash_Flow_Statement
WHERE Cash_Flow_Statement.股票代码 = 66 AND Cash_Flow_Statement.年度 = 2022;

SELECT 税金及附加 
FROM Income_Statement 
WHERE 股票代码 = 1 AND 年度 = 2022;

SELECT  营业外收入 
FROM Income_Statement 
WHERE 年度 = 2021 AND 股票代码 = 5;

SELECT Income_Statement.股票简称, (Income_Statement.营业总成本 / Income_Statement.营业总收入) AS 成本收入比
FROM Income_Statement
WHERE Income_Statement.年度 = 2021 AND Income_Statement.股票简称 = '平安银行';

SELECT Cash_Flow_Statement.年度, Cash_Flow_Statement.取得借款收到的现金 
FROM Cash_Flow_Statement 
WHERE Cash_Flow_Statement.股票简称 = '德赛电池' AND Cash_Flow_Statement.年度 = 2022;

SELECT ((SELECT Net_Income FROM Income_Statement WHERE 股票简称 = 'ST 星源' AND 年度 = 2021) / (SELECT 资产总计 FROM Balance_Sheet WHERE 股票简称 = 'ST 星源' AND 截止日期 = '2021年度')) * 100 as 总资产收益率
FROM Income_Statement
WHERE 股票简称 = 'ST 星源' AND 年度 = 2021;

SELECT 投资收益中：对联营企业和合营企业的投资收益 
FROM Income_Statement 
WHERE 公司全称 = '深圳市振业' AND 年度 = 2021;
